■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ グローブライド NEW 16 トーナメント磯 AGS DAIWA TOURNAMENT ISO AGS TM磯竿 フカセ竿 グレ竿 チヌ竿 <br /><br />TOURNAMENT、新章へ。<br /><br />「細・軽・ピン」から「細・軽・靱」へ。新たなるTOURNAMENT調子<br />「粘り」を鍛え「靱」と成す。<br /><br />よりシャープに、よりスピーディに……。競技会における“効率”を追い求めてきた歴代TOURNAMENT。しかし時は流れ、現代は“一尾を確実に獲る”時代。新TOURNAMENTが現代への最適化を図るべく導き出した解は、さらなる“粘り”の追求だった。 <br /><br />■新調子：粘靱ブランク<br />■『SVFナノプラス』採用で細身化・パワーアップを実現<br />■『次世代NリングAGS』搭載により従来よりも優れた操作性を実現<br />■専用設計されたリールシートでリールのガタつきを払拭<br />■キャスト時のブレやネジレを防ぐ『X45』搭載<br />■ICガードによりべたつき防止(#3～#4)<br />■競技には感度に優れた『SMT』を採用し、より繊細なゲームが可能<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
