■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">がまかつ がま磯 黒冴 チヌ竿 Gamakatsu 黒鯛 クロダイ ロッド 磯竿 フカセ竿<br /><br />ＡＳＤと細身設計により、美しい弧を描く粘りのある胴調子に設定。スーパートップIIとナノアロイR技術の採用により穂先部の軽量化を図り、胴調子にありがちな振り感のダルさを解消するとともに、快適な操作性も手に入れています。さらに、コンパクトに握ることができ、操作性に優れた軽量オリジナルリールシートや、グリップを肘にあてがうポジションでのやり取りで優れたグリップ力を発揮するＥＶＡ素材のリアグリップも採用しています。この竿が持つ、一尾とのやり取りを味わい尽くせる釣り味を、どうぞご堪能ください。<br /><br />■0号-53 <br />味わい最優先の粘り胴調子チヌ竿の決定版。<br /><br />■0.6号-53 <br />シリーズ中のオールラウンダー的存在。小型の数釣りから大型狙いまで幅広く対応します。<br />■1号-53 <br />大型対応モデル。大型チヌとのやりとりを楽しみながらも、主導権をキープできる地力が自慢です。<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
